import React from 'react';
import './index.css';
import Cards from './cards';

const App = () => {
    return (
        <>
            <div className="col-lg-3">
                <div className="ro">
                    <h1>Heading</h1>
                    <Cards />
                </div>
            </div>
        </>
    )
};

export default App;
